CREATE DATABASE IF NOT EXISTS `sefprueba`;

USE sefprueba;

DROP TABLE IF EXISTS `ajustes`;

CREATE TABLE `ajustes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `codigo` char(15) COLLATE utf8_spanish_ci NOT NULL,
  `a1` int(1) NOT NULL,
  `a2` int(1) NOT NULL,
  `a3` int(1) NOT NULL,
  `a4` int(1) NOT NULL,
  `a5` int(1) NOT NULL,
  `a6` int(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `alumnos`;

CREATE TABLE `alumnos` (
  `idalumno` int(11) NOT NULL AUTO_INCREMENT,
  `idcole` double DEFAULT NULL,
  `idgrado` int(255) DEFAULT NULL,
  `ciclo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `corto` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `grado` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `seccion` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `clave` double DEFAULT NULL,
  `codigo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `apellidos` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nombres` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `genero` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `nd` double DEFAULT NULL,
  `nm` double DEFAULT NULL,
  `na` double DEFAULT NULL,
  `nacimiento` date NOT NULL,
  `nacionalidad` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `doc` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nodoc` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `encargado` varchar(255) COLLATE utf8_spanish_ci NOT NULL,
  `telencargado` varchar(15) COLLATE utf8_spanish_ci NOT NULL,
  `otros` varchar(255) COLLATE utf8_spanish_ci NOT NULL,
  `activo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `ultimaactualizacion` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `insertdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`idalumno`),
  KEY `idgrado` (`idgrado`),
  CONSTRAINT `alumnos_ibfk_1` FOREIGN KEY (`idgrado`) REFERENCES `grados` (`idgrado`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `alumnosauto`;

CREATE TABLE `alumnosauto` (
  `idalumno` double NOT NULL,
  `idcole` double DEFAULT NULL,
  `idgrado` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `ciclo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `corto` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `grado` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `seccion` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `clave` double DEFAULT NULL,
  `codigo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `apellidos` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nombres` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nd` double DEFAULT NULL,
  `nm` double DEFAULT NULL,
  `na` double DEFAULT NULL,
  `nacionalidad` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `doc` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nodoc` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `activo` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`idalumno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `amistades`;

CREATE TABLE `amistades` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `enviado` char(15) COLLATE utf8_spanish_ci NOT NULL,
  `recibido` char(15) COLLATE utf8_spanish_ci NOT NULL,
  `amigos` int(1) NOT NULL,
  `solicitud` int(11) NOT NULL,
  `fecha` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `analitycs`;

CREATE TABLE `analitycs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `usuario` char(20) COLLATE utf8_spanish_ci NOT NULL,
  `fecha` date NOT NULL,
  `hora` time NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `asesores`;

CREATE TABLE `asesores` (
  `idasesor` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `idcole` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `idgrado` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `seccion` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `idpersonal` char(25) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`idasesor`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `bitacora`;

CREATE TABLE `bitacora` (
  `idbitacora` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `asociado` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `accion` char(50) COLLATE utf8_spanish_ci NOT NULL,
  `afectado` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `mensaje` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `fecha` date NOT NULL,
  `hora` time NOT NULL,
  PRIMARY KEY (`idbitacora`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `calificaciones`;

CREATE TABLE `calificaciones` (
  `idcalif` int(6) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `idcole` int(11) NOT NULL,
  `idgrado` int(11) NOT NULL,
  `idalumno` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `codigo` char(25) CHARACTER SET utf8 NOT NULL,
  `pro` int(6) NOT NULL,
  `pun` int(6) NOT NULL,
  `cp1` int(3) NOT NULL,
  `cp2` int(3) NOT NULL,
  `cp3` int(3) NOT NULL,
  `cp4` int(3) NOT NULL,
  `cpt` int(11) NOT NULL,
  `li` int(6) NOT NULL,
  `lg` int(6) NOT NULL,
  `ls` int(6) NOT NULL,
  PRIMARY KEY (`idcalif`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci ROW_FORMAT=COMPACT COMMENT='tabla de calificaciones de los alumnos';




DROP TABLE IF EXISTS `colegio`;

CREATE TABLE `colegio` (
  `idcole` int(25) NOT NULL AUTO_INCREMENT,
  `nombre` char(200) COLLATE utf8_spanish_ci NOT NULL,
  `abr` char(10) COLLATE utf8_spanish_ci NOT NULL,
  `lema` varchar(220) COLLATE utf8_spanish_ci NOT NULL,
  `direccion` char(200) COLLATE utf8_spanish_ci NOT NULL,
  `telefono` char(10) COLLATE utf8_spanish_ci NOT NULL,
  `email` varchar(100) COLLATE utf8_spanish_ci NOT NULL,
  `bloqueactual` int(1) NOT NULL,
  `activo` char(2) COLLATE utf8_spanish_ci NOT NULL,
  `logo` char(200) COLLATE utf8_spanish_ci NOT NULL,
  `logodoc` char(200) COLLATE utf8_spanish_ci NOT NULL,
  `token` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `pf` int(1) NOT NULL,
  `primaria` int(11) NOT NULL,
  `basico` int(11) NOT NULL,
  `diversificado` int(11) NOT NULL,
  PRIMARY KEY (`idcole`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




