DROP TABLE IF EXISTS `cuotas`;

CREATE TABLE `cuotas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `inscripcion` int(6) NOT NULL,
  `operacion` int(6) NOT NULL,
  `mensualidad` int(6) NOT NULL,
  `compuinscri` int(6) NOT NULL,
  `compumensu` int(6) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci;




DROP TABLE IF EXISTS `edades`;

CREATE TABLE `edades` (
  `idresultado` int(11) NOT NULL AUTO_INCREMENT,
  `idcole` int(11) NOT NULL,
  `edades` varchar(15) COLLATE utf8_spanish_ci NOT NULL,
  `cantidades` int(6) NOT NULL,
  PRIMARY KEY (`idresultado`)
) ENGINE=InnoDB AUTO_INCREMENT=1466 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `edadesxgrado`;

CREATE TABLE `edadesxgrado` (
  `idresultado` int(11) NOT NULL AUTO_INCREMENT,
  `idgrado` int(11) NOT NULL,
  `idcole` int(11) NOT NULL,
  `edades` varchar(15) COLLATE utf8_spanish_ci NOT NULL,
  `cantidades` int(6) NOT NULL,
  PRIMARY KEY (`idresultado`),
  KEY `idgrado` (`idgrado`),
  CONSTRAINT `edadesxgrado_ibfk_1` FOREIGN KEY (`idgrado`) REFERENCES `grados` (`idgrado`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1403 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `grados`;

CREATE TABLE `grados` (
  `idgrado` int(25) NOT NULL AUTO_INCREMENT,
  `idcole` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `ciclo` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `grado` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `tipo` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `nombre` varchar(300) COLLATE utf8_spanish_ci NOT NULL,
  `corto` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `boton` char(50) COLLATE utf8_spanish_ci NOT NULL,
  `sec1` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `sec2` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `sec3` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `sec4` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `sec5` char(1) COLLATE utf8_spanish_ci NOT NULL,
  `activo` char(15) COLLATE utf8_spanish_ci NOT NULL,
  `clases` int(2) NOT NULL,
  PRIMARY KEY (`idgrado`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;




DROP TABLE IF EXISTS `materias`;

CREATE TABLE `materias` (
  `idmateria` int(6) NOT NULL AUTO_INCREMENT,
  `idcole` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `idgrado` int(11) NOT NULL,
  `seccion` char(2) COLLATE utf8_spanish_ci NOT NULL,
  `num` int(3) NOT NULL,
  `idnombremateria` int(11) NOT NULL,
  `corto` char(25) COLLATE utf8_spanish_ci NOT NULL,
  `idprofesor` int(11) NOT NULL,
  `activo` char(2) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`idmateria`),
  KEY `idnombremateria` (`idnombremateria`),
  KEY `materias_ibfk_2` (`idprofesor`),
  KEY `idgrado` (`idgrado`),
  CONSTRAINT `materias_ibfk_1` FOREIGN KEY (`idnombremateria`) REFERENCES `nombrematerias` (`idnombremateria`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `materias_ibfk_2` FOREIGN KEY (`idprofesor`) REFERENCES `profesores` (`idprofesor`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `materias_ibfk_3` FOREIGN KEY (`idgrado`) REFERENCES `grados` (`idgrado`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci ROW_FORMAT=COMPACT;




DROP TABLE IF EXISTS `materias2`;

CREATE TABLE `materias2` (
