) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci ROW_FORMAT=COMPACT;




DROP TABLE IF EXISTS `nombrematerias`;

CREATE TABLE `nombrematerias` (
  `idnombremateria` int(11) NOT NULL AUTO_INCREMENT,
